import React from 'react'
import {PRODUCT} from '../../components/products'
import {Product} from './Product'
function Shop() {
  return (
    <div>
      
      <div className="shop">
        <div className='shopTitle'>
          <h1>Gadget Shop</h1>
        </div>

        <div className="products">
          {PRODUCT.map((product)=>{
            <Product data={product}/>
          })}

        </div>
      </div>
    </div>
  )
}

export default Shop
